import React from 'react';
import 'mdb-react-ui-kit/dist/css/mdb.min.css'
import { ResponsiveBar } from '@nivo/bar'

const MyResponsiveBar = ({ data = [
	{
	  "country": "AD",
	  "hot dog": 64,
	  "hot dogColor": "hsl(118, 70%, 50%)",
	  "burger": 95,
	  "burgerColor": "hsl(127, 70%, 50%)",
	  "sandwich": 172,
	  "sandwichColor": "hsl(167, 70%, 50%)",
	  "kebab": 112,
	  "kebabColor": "hsl(249, 70%, 50%)",
	  "fries": 125,
	  "friesColor": "hsl(80, 70%, 50%)",
	  "donut": 115,
	  "donutColor": "hsl(40, 70%, 50%)"
	},
	{
	  "country": "AE",
	  "hot dog": 137,
	  "hot dogColor": "hsl(4, 70%, 50%)",
	  "burger": 30,
	  "burgerColor": "hsl(237, 70%, 50%)",
	  "sandwich": 84,
	  "sandwichColor": "hsl(305, 70%, 50%)",
	  "kebab": 200,
	  "kebabColor": "hsl(350, 70%, 50%)",
	  "fries": 112,
	  "friesColor": "hsl(172, 70%, 50%)",
	  "donut": 116,
	  "donutColor": "hsl(113, 70%, 50%)"
	},
	{
	  "country": "AF",
	  "hot dog": 195,
	  "hot dogColor": "hsl(222, 70%, 50%)",
	  "burger": 58,
	  "burgerColor": "hsl(324, 70%, 50%)",
	  "sandwich": 39,
	  "sandwichColor": "hsl(298, 70%, 50%)",
	  "kebab": 144,
	  "kebabColor": "hsl(8, 70%, 50%)",
	  "fries": 154,
	  "friesColor": "hsl(356, 70%, 50%)",
	  "donut": 62,
	  "donutColor": "hsl(237, 70%, 50%)"
	},
	{
	  "country": "AG",
	  "hot dog": 48,
	  "hot dogColor": "hsl(315, 70%, 50%)",
	  "burger": 85,
	  "burgerColor": "hsl(80, 70%, 50%)",
	  "sandwich": 19,
	  "sandwichColor": "hsl(55, 70%, 50%)",
	  "kebab": 105,
	  "kebabColor": "hsl(327, 70%, 50%)",
	  "fries": 149,
	  "friesColor": "hsl(40, 70%, 50%)",
	  "donut": 37,
	  "donutColor": "hsl(327, 70%, 50%)"
	},
	{
	  "country": "AI",
	  "hot dog": 90,
	  "hot dogColor": "hsl(237, 70%, 50%)",
	  "burger": 191,
	  "burgerColor": "hsl(273, 70%, 50%)",
	  "sandwich": 48,
	  "sandwichColor": "hsl(120, 70%, 50%)",
	  "kebab": 118,
	  "kebabColor": "hsl(107, 70%, 50%)",
	  "fries": 200,
	  "friesColor": "hsl(164, 70%, 50%)",
	  "donut": 154,
	  "donutColor": "hsl(287, 70%, 50%)"
	},
	{
	  "country": "AL",
	  "hot dog": 8,
	  "hot dogColor": "hsl(47, 70%, 50%)",
	  "burger": 186,
	  "burgerColor": "hsl(336, 70%, 50%)",
	  "sandwich": 42,
	  "sandwichColor": "hsl(337, 70%, 50%)",
	  "kebab": 88,
	  "kebabColor": "hsl(28, 70%, 50%)",
	  "fries": 74,
	  "friesColor": "hsl(278, 70%, 50%)",
	  "donut": 57,
	  "donutColor": "hsl(161, 70%, 50%)"
	},
	{
	  "country": "AM",
	  "hot dog": 98,
	  "hot dogColor": "hsl(5, 70%, 50%)",
	  "burger": 141,
	  "burgerColor": "hsl(31, 70%, 50%)",
	  "sandwich": 120,
	  "sandwichColor": "hsl(290, 70%, 50%)",
	  "kebab": 158,
	  "kebabColor": "hsl(171, 70%, 50%)",
	  "fries": 20,
	  "friesColor": "hsl(222, 70%, 50%)",
	  "donut": 28,
	  "donutColor": "hsl(16, 70%, 50%)"
	}
  ]  }) => (
    <ResponsiveBar
        data={data}
        keys={[
            'hot dog',
            'burger',
            'sandwich',
            'kebab',
            'fries',
            'donut'
        ]}
        indexBy="country"
        margin={{ top: 50, right: 130, bottom: 50, left: 60 }}
        padding={0.3}
        valueScale={{ type: 'linear' }}
        indexScale={{ type: 'band', round: true }}
        colors={{ scheme: 'nivo' }}
        defs={[
            {
                id: 'dots',
                type: 'patternDots',
                background: 'inherit',
                color: '#38bcb2',
                size: 4,
                padding: 1,
                stagger: true
            },
            {
                id: 'lines',
                type: 'patternLines',
                background: 'inherit',
                color: '#eed312',
                rotation: -45,
                lineWidth: 6,
                spacing: 10
            }
        ]}
        fill={[
            {
                match: {
                    id: 'fries'
                },
                id: 'dots'
            },
            {
                match: {
                    id: 'sandwich'
                },
                id: 'lines'
            }
        ]}
        borderColor={{
            from: 'color',
            modifiers: [
                [
                    'darker',
                    1.6
                ]
            ]
        }}
        axisTop={null}
        axisRight={null}
        axisBottom={{
            tickSize: 5,
            tickPadding: 5,
            tickRotation: 0,
            legend: 'country',
            legendPosition: 'middle',
            legendOffset: 32
        }}
        axisLeft={{
            tickSize: 5,
            tickPadding: 5,
            tickRotation: 0,
            legend: 'food',
            legendPosition: 'middle',
            legendOffset: -40
        }}
        labelSkipWidth={12}
        labelSkipHeight={12}
        labelTextColor={{
            from: 'color',
            modifiers: [
                [
                    'darker',
                    1.6
                ]
            ]
        }}
        legends={[
            {
                dataFrom: 'keys',
                anchor: 'bottom-right',
                direction: 'column',
                justify: false,
                translateX: 120,
                translateY: 0,
                itemsSpacing: 2,
                itemWidth: 100,
                itemHeight: 20,
                itemDirection: 'left-to-right',
                itemOpacity: 0.85,
                symbolSize: 20,
                effects: [
                    {
                        on: 'hover',
                        style: {
                            itemOpacity: 1
                        }
                    }
                ]
            }
        ]}
        role="application"
        ariaLabel="Nivo bar chart demo"
        barAriaLabel={function(e){return e.id+": "+e.formattedValue+" in country: "+e.indexValue}}
    />
)

function Main(props) {
	return (
		<>
			{ MyResponsiveBar }
		</>
	);
};

export default Main;
